  CardTitle, CardSubtitle,CardImgOverlay,Navbar,Button,DropdownButton,Grid,UncontrolledAlert,TabContent,Row, Col} from 'reactstrap'
//import './App.css';
import Empl from  './components/employee_details'
class App extends Component {
  render() {
    return (
      <div>
        <Row>
        <Card>
          <CardBody>
            <CardImg top width="25%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />
            <CardTitle>Card title</CardTitle>
            <CardSubtitle>Card subtitle</CardSubtitle>
            <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
            <Button>Button</Button>
          </CardBody>
        </Card>
        </Row>
      </div>
    );
  }
}

export default App;
